import Vue from 'vue';
import Router from 'vue-router';
import HelloContainer from "./components/HelloWorld.vue";
import testContainer from "./components/testContainer.vue";
import Home from "./components/tabbar/Home.vue";
import Newslist from "./components/home/NewsList.vue";
import test01 from "./components/test/test01.vue";
import test02 from "./components/test/test02.vue";
import Newsinfo from "./components/home/Newsinfo.vue";
import Goodslist from "./components/product/GoodsList.vue";
import Goodsinfo from "./components/product/GoodsInfo.vue";
import Register from "./components/tabbar/register.vue";
import Login from "./components/tabbar/Login.vue";
import Shoplist from "./components/tabbar/ShopList.vue";
import Logout from "./components/home/Logout.vue";
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/',
    redirect: "/home"
  }, {
    path: '/test',
    component: testContainer
  }, {
    path: '/home',
    component: Home
  }, {
    path: '/newslist',
    component: Newslist
  }, {
    path: '/test01',
    component: test01
  }, {
    path: '/test02/:age',
    component: test02
  }, {
    path: '/newsinfo',
    component: Newsinfo
  }, {
    path: '/Goodslist',
    component: Goodslist
  }, {
    path: '/Goodsinfo/:id',
    component: Goodsinfo
  }, {
    path: '/register',
    component: Register
  }, {
    path: '/login',
    component: Login
  }, {
    path: '/shoplist',
    component: Shoplist
  }, {
    path: '/logout',
    component: Logout
  }]
});
